        for (int j = 0; j < 32; ++j) {
            if (nums[i] & (1 << j)) {
                bits[j]++;
            }
        }
    }

    long long result = 0;
    for (int i = 0; i < k; ++i) {
        long long num = 0;
        for (int j = 0; j < 32; ++j) {
